import React, { Component } from 'react'
import { Card, Container, Header, Label, Image, Divider, Icon, Form, Grid, Segment, Button} from 'semantic-ui-react'
import Events from '../Sections/Events/Events';
import AddEvent from '../Sections/AddEvent/AddEvent';

export default class StoryDetail extends Component {


  render() {
    return (
    <Container>
        <Divider style={{color:'white'}} horizontal color='white'> Events</Divider>
        <Events/>
       
        <Divider style={{color:'white'}} horizontal color='white'> Add? </Divider>
        <AddEvent/>
        <Divider  style={{color:'white'}} horizontal color='white'> Comments </Divider>

    </Container>

    )
  }
}
